import tabs from '../../db.json';
import { ListSuffixes, ListItem } from './NavigationSuffix.styled';

export const NavigationSuffix = ({ ss, k }) => {
  const onClick = (event) => {
    ss(event.target.outerText);
  };

  // console.log(tabs.chords.A);
  let activeSuffix = tabs.chords.A.flatMap((chord) => chord.suffix);
  let allSuffix = tabs.chords.A;

  const resultSuffixes = [];

  for (let i = 0; i < allSuffix.length; i++) {
    console.log(tabs.chords.A[i].suffix === activeSuffix[i]);
    resultSuffixes.push({
      suffix: '1',
      isActive: false,
    });
  }
  console.log(resultSuffixes);

  return (
    <div>
      <ListSuffixes>
        {tabs.suffixes.map((suffix) => {
          // console.log(suffix);
          return (
            <ListItem key={suffix} onClick={onClick} active={false}>
              {suffix}
            </ListItem>
          );
        })}
      </ListSuffixes>
    </div>
  );
};
